import React from "react";
import Navigation from "../components/Navigation";
import Hero from "../components/Hero";

const Home = () => {
  return (
    <div>
      <Navigation />
      <div className="heros">
        <Hero bgimage="../images/hero-background-image.jpg" />
        <Hero bgimage="../images/backgroundnoir.png" />
      </div>
    </div>
  );
};

export default Home;
